import FormApp from './Form'
import { connect } from 'react-redux'

class Form extends PureComponent {
    constructor(){
        super()
        this.state = {
            text : "tezt"
        }
}
    render () {
        return(
            <FormApp
            value={this.props.text}
            />
        )
    }
}

const mapStateToProps = (state) => {
    return {
        counter: state
    }
}
